log("System Ready.");

// 1.  SW1 
waitSW(1); 
log("Robot Starting...");

while(true) {
    var lineL = analogRead(0); // 
    var lineR = analogRead(1); // 

    if (lineL > 500) {
        motor(20, 60); // 
    } else if (lineR > 500) {
        motor(60, 20); // 
    } else {
        motor(50, 50); // 
    }

    //  SW3
    if (SW(3)) {
        motor(0, 0);
        log("Emergency Stop!");
        break;
    }

    delay(1); // 
}
